// import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import PrivateRoute from './components/PrivateRoute';

// ---- Mock Data ----
const summaryMetrics = {
  totalTransactions: 100,
  totalAmount: 50000,
  successful: 80,
  failed: 20,
};

const categoryData = [
  { name: "Food", value: 20 },
  { name: "Travel", value: 30 },
  { name: "Shopping", value: 25 },
  { name: "Other", value: 25 },
];

const barData = [
  { name: "Jan", total: 5000, W1: 1200, W2: 1300, W3: 1200, W4: 1300 },
  { name: "Feb", total: 4000, W1: 1000, W2: 1000, W3: 1000, W4: 1000 },
  { name: "Mar", total: 6000, W1: 1500, W2: 1500, W3: 1500, W4: 1500 },
  { name: "Apr", total: 3500, W1: 900, W2: 900, W3: 850, W4: 850 },
];

const transactions = [
  {
    id: 1,
    date: "2025-06-01",
    description: "Lunch",
    category: "Food",
    user: "Alice",
    amount: 250,
    status: "success",
  },
  {
    id: 2,
    date: "2025-06-02",
    description: "Bus Ticket",
    category: "Travel",
    user: "Bob",
    amount: 100,
    status: "failed",
  },
  {
    id: 3,
    date: "2025-06-03",
    description: "Shoes",
    category: "Shopping",
    user: "Charlie",
    amount: 1200,
    status: "pending",
  },
  {
    id: 4,
    date: "2025-06-04",
    description: "Dinner",
    category: "Food",
    user: "Alice",
    amount: 500,
    status: "success",
  },
];

const users = [
  { id: 1, name: "Alice" },
  { id: 2, name: "Bob" },
  { id: 3, name: "Charlie" },
];

const categories = [
  { id: 1, name: "Food" },
  { id: 2, name: "Travel" },
  { id: 3, name: "Shopping" },
  { id: 4, name: "Other" },
];

function handleLogout() {
  alert("Logged out!");
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route
          path="/dashboard"
          element={
            <PrivateRoute>
              <Dashboard
                summaryMetrics={summaryMetrics}
                categoryData={categoryData}
                barData={barData}
                transactions={transactions}
                users={users}
                categories={categories}
                handleLogout={handleLogout}
              />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
